import React from 'react';
import CallToAction from './CallToAction';
import CustomersSay from './CustomersSay';
import Homepage from './Homepage';
import Chicago from './Chicago';
import BookingPage from './BookingPage';

function Main() {
    return (
        <main>
            <CallToAction />
            <Homepage />
            <Chicago />
            <BookingPage />
            <CustomersSay />
        </main>
    );
}

export default Main;
